import React, { useState, useEffect } from 'react';
import './Dishes.css';

function Dishes() {
    const [dishes, setDishes] = useState([]);

    useEffect(() => {
        fetch('/dishes')
            .then(response => response.json())
            .then(data => setDishes(data));
    }, []);

    return (
        <div className="container">
            <h2>Блюда</h2>
            <table id="dishesTable">
                <thead>
                <tr>
                    <th>ID</th>
                    <th>Название</th>
                    <th>Ингредиенты</th>
                    <th>Калории</th>
                </tr>
                </thead>
                <tbody>
                {dishes.map(dish => (
                    <tr key={dish.id}>
                        <td>{dish.id}</td>
                        <td>{dish.name}</td>
                        <td>
                            <ul>
                                {dish.ingredients.map(ingredient =>
                                    <li key={ingredient}>{ingredient}</li>
                                )}
                            </ul>
                        </td>
                        <td>{dish.calories.toFixed(2)}</td>
                    </tr>
                ))}
                </tbody>
            </table>
            {/* Добавьте формы тут при необходимости */}
            <a href="/" className="back-link">Назад на главную</a>
        </div>
    );
}

export default Dishes;
